INSERT INTO `vue_agences` VALUES (1,'Grenelle','Exp√©rience Clients','L‚ÄôAgence Exp√©rience Clients a √©t√© cr√©√©e pour r√©pondre √† l‚Äôenjeu de la satisfaction des clients de la DR Paris.\r\nRattach√©e au Service Raccordement Clients Ing√©nierie, l‚Äôagence a pour principal objectif le pilotage de la satisfaction clients, le traitement des r√©clamations et des saisines issues des m√©diateurs ainsi que le pilotage de projets relations clients transverses au sein de la DR.\r\n','127 boulevard de Grenelle, 75015 Paris','https://www.google.fr/maps/place/Espace+Grenelle+Enedis/@48.8488603,2.297629,17z/data=!3m1!4b1!4m6!3m5!1s0x47e67022f2d2afb1:0x740f4bb89afe6fa6!8m2!3d48.8488603!4d2.3002039!16s%2Fg%2F11dxqk22gc?entry=ttu','Raccordement Clients et Ing√©nierie',NULL,'1307761',NULL,NULL),(2,'Grenelle','Acc√®s au r√©seau de Distribution','L\'agence ARD assure la mission de gestion de l\'acc√®s au r√©seau de distribution pour ses clients producteurs et consommateurs √† enjeux. Par un contact personnalis√©, elle s\'assure de leur satisfaction et de la bonne prise en compte de leurs attentes en coordination avec les diff√©rentes entit√©s Enedis concern√©es. L\'ARD g√®re les contrats CARD-Soutirage et les contrats CARD-injection','22 rue du Laos, 75015 Paris','https://www.google.fr/maps/place/Espace+Grenelle+Enedis/@48.8488603,2.297629,17z/data=!3m1!4b1!4m6!3m5!1s0x47e67022f2d2afb1:0x740f4bb89afe6fa6!8m2!3d48.8488603!4d2.3002039!16s%2Fg%2F11dxqk22gc?entry=ttu','Raccordement Clients et Ing√©nierie',NULL,'13077683',NULL,NULL),(3,'Grenelle','Acheminement','Le Service Clients d\'Enedis Paris occupe une position centrale en tant que point n√©vralgique pour toutes les demandes √©manant des clients envers le distributeur. Ses activit√©s diversifi√©es englobent la gestion des demandes des fournisseurs d\\\'√©nergie ainsi que la coordination des activit√©s de relev√© en vue de la facturation.\r\nLes missions du Service Clients se distinguent par leur polyvalence :\r\n\r\n- Il prend e